import React from 'react';
import { useNavigate } from 'react-router-dom';

const spaces = [
  { id: 1, name: 'Garage Espacioso', price: '$100/mes' },
  { id: 2, name: 'AlmacÃ©n Seguro', price: '$150/mes' },
  { id: 3, name: 'Espacio Premium', price: '$200/mes' },
];

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="home">
      <h1>ðŸš€ Bienvenido a Garage Share ðŸš€</h1>
      <p>Encuentra el espacio perfecto para tus cosas.</p>

      <div className="spaces">
        {spaces.map((space) => (
          <div
            key={space.id}
            className="space-card"
            onClick={() => navigate(`/space/${space.id}`)}
          >
            <h2>{space.name}</h2>
            <p>{space.price}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
